import React, {Component} from 'react'
import Table from './Table'

class App extends Component {
  state = {
    characters: [
      {
        name: 'Charlie',
        job: 'Janitor',
      },
      {
        name: 'Mac',
        job: 'Bouncer',
      },
      {
        name: 'Dee',
        job: 'Aspring actress',
      },
      {
        name: 'Dennis',
        job: 'Bartende',
      },
    ]
  }
  render() {
    const characters = [
      {
        name: 'Charlie',
        job: 'Janitor',
      },
      {
        name: 'Mac',
        job: 'Bouncer',
      },
      {
        name: 'Dee',
        job: 'Aspring actress',
      },
      {
        name: 'Dennis',
        job: 'Bartende',
      },
    ]

    return (
      <div className="App">
        <h1>Hello, React!</h1>
        <div className="container">
    <Table characterData={characters} removeCharacter={this.removeCharacter} />
  </div>
      </div>
    )
  }
}

export default App
